import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {


	return (
		<div>
			{
				pets.map((pet, i) => {
						var img;
						var file;
						for (img in images) {
							if (pets[i].id) {
								file = img.url;
								console.log(file);
								return <Card key={pets[i].id} img={'http://localhost:4412/api/file/' + file} name={pets[i].name} description={pets[i].description}/>
							}
						}
					return null;
				})
			}
		</div>
	);
}

export default CardList;
